--##
update print_layout set template = ''
where id='DELIVERY_RECEIPT';
update print_layout set template = ''
where id='PURCHASE_REGISTER_DETAIL';
with a as (select id, template from print_layout where id = 'DELIVERY_RECEIPT')
update print_template pt set template=a.template from a where pt.layout=a.id and pt.is_default = true;
with a as (select id, template from print_layout where id = 'PURCHASE_REGISTER_DETAIL')
update print_template pt set template=a.template from a where pt.layout=a.id and pt.is_default = true;
--##